function createBarChartGroupedInstall(a,e,l){for(var a=document.getElementById(a),t={labels:l.xReferenceInstall,datasets:[]},s=0;s<l.Installlabels.length;s++)t.datasets[s]={label:l.Installlabels[s],data:l.Installdata[l.Installlabels[s]]},t.datasets[s].backgroundColor=DashBoardColors.background[s+4];new Chart(a,{type:"bar",data:t,options:{responsive:!0,maintainAspectRatio:!1,barValueSpacing:20,scales:{yAxes:[{ticks:{min:0}}],xAxes:[{gridLines:{display:!1}}]},title:{display:!0,text:e},legend:{display:!0,labels:{boxWidth:10,fontSize:8}}}})}